import React from "react";

const Resume = (props) => {
  return (
    <div>
      <h2 className="resumeTitle">Parcours</h2>
      <p className="resumeText">
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla arcu
        urna, venenatis sit amet metus nec, blandit accumsan leo. Proin maximus
        dapibus augue. Proin feugiat quam eu sodales varius. Maecenas at libero
        viverra, egestas massa sit amet, fringilla enim. Pellentesque sed
        rhoncus nunc, sed laoreet nibh. Sed id pretium lacus. Nunc tempor dui
        sed ante commodo, non placerat risus eleifend. Nam tincidunt ultrices
        arcu vel pellentesque.
      </p>
    </div>
  );
};

export default Resume;
